    "i2d/mpe/wcqueue/manages1/customer.zmpe.wcque.mgs1.ext/blocks/OperationInProgressControllerCustom.controller.js":
    function () {
      sap.ui.define(
        [
          "sap/ui/model/Filter",
          "sap/ui/model/FilterOperator",
          "../utils/NavHelper",
          "../utils/util",
        ],
        function (e, t, i, r) {
          "use strict";
          return sap.ui.controller(
            "i2d.mpe.wcqueue.manages1.customer.zmpe.wcque.mgs1.ext.blocks.OperationInProgressControllerCustom",
            {
              handleOrdersSearch: function (i) {
                var r = this.getView().getModel("DetailModel");
                var a = r.getData();
                var l = a.WorkCenter;
                var n = a.ProductionPlant;
                var o = i.getParameter("query");
                this._oGlobalFilter = null;
                if (l && n) {
                  this._oGlobalFilter = new e({
                    and: true,
                    filters: [
                      new sap.ui.model.Filter({
                        and: false,
                        filters: [
                          new e("ManufacturingOrder", t.Contains, o),
                          new e("Material", t.Contains, o),
                          new e("MaterialName", t.Contains, o),
                          new e("ZZWBSElement", t.Contains, o),
                        ],
                      }),
                      new sap.ui.model.Filter({
                        and: false,
                        filters: [
                          new sap.ui.model.Filter(
                            "OperationIsConfirmed",
                            sap.ui.model.FilterOperator.EQ,
                            " "
                          ),
                        ],
                      }),
                      new sap.ui.model.Filter({
                        and: true,
                        filters: [
                          new sap.ui.model.Filter(
                            "WorkCenter",
                            sap.ui.model.FilterOperator.EQ,
                            l
                          ),
                          new sap.ui.model.Filter(
                            "ProductionPlant",
                            sap.ui.model.FilterOperator.EQ,
                            n
                          ),
                        ],
                      }),
                    ],
                  });
                }
                this._filter();
              },
            }
          );
        }
      );
    },
